import React from 'react'
import books from '../books'

const BooksScreen = () => {
    return (
        <div>
            <h1>Popular books</h1>
        <Row>
            {books.map((book)=>(
                <Col key={book._id} sm={6} md={4} lg={3} xl={2}>
                    <Book book={book} />
                </Col>
            ))}
        </Row>
        </div>
    )
}

export default BooksScreen
